
import datetime
import random
import sqlite3 as sql

conn = sql.connect('restaurant.db')


conn.execute("CREATE TABLE branch ( \
	branch_id	TEXT NOT NULL, \
	location	TEXT, supplier_id TEXT, \
	contact_no	TEXT NOT NULL UNIQUE, \
	timings	TEXT, \
	PRIMARY KEY(branch_id), \
    CONSTRAINT fk_supplier_id FOREIGN KEY(supplier_id) REFERENCES supplier(supplier_id) ON DELETE CASCADE \
);")



conn.execute("CREATE TABLE owner ( \
    owner_id TEXT, \
	contact_no	TEXT NOT NULL UNIQUE, \
	name	 TEXT, \
	branch_id	TEXT NOT NULL , \
	PRIMARY KEY(owner_id), \
    CONSTRAINT fk_branch_id FOREIGN KEY(branch_id) REFERENCES branch(branch_id) ON DELETE CASCADE \
);")



conn.execute("CREATE TABLE supplier ( \
	contact_no	TEXT NOT NULL , \
	supplier_id	TEXT, \
	name	 TEXT, \
	address	TEXT, \
	PRIMARY KEY(supplier_id) \
);")


conn.execute("CREATE TABLE employee ( \
	employee_id	TEXT, \
	name	TEXT, \
	contact_no	TEXT NOT NULL UNIQUE, \
	salary	INTEGER NOT NULL, \
	designation	TEXT, \
	branch_id	TEXT NOT NULL, \
	PRIMARY KEY(employee_id), \
    CONSTRAINT fk_branch_id FOREIGN KEY(branch_id) REFERENCES branch(branch_id) ON DELETE CASCADE \
);")


conn.execute("CREATE TABLE customer ( \
	customer_id	TEXT, \
	name	TEXT, \
	contact_no	TEXT NOT NULL, \
	email_id	TEXT, \
	PRIMARY KEY(customer_id)  \
);")



conn.execute("CREATE TABLE orders ( order_id	TEXT, \
	customer_name	TEXT, \
	customer_id	TEXT, branch_id TEXT, \
    order_date DATE ,\
	PRIMARY KEY(order_id) ,\
    CONSTRAINT fk_branch_id FOREIGN KEY(branch_id) REFERENCES branch(branch_id) ON DELETE CASCADE,\
    CONSTRAINT fk_customer_id FOREIGN KEY(customer_id) REFERENCES customer(customer_id) ON DELETE CASCADE,\
    CONSTRAINT fk_customer_name FOREIGN KEY(customer_name) REFERENCES customer(name) ON DELETE CASCADE\
 );")


conn.execute("CREATE TABLE bill ( \
	bill_id	TEXT, \
	bill_date	DATE, \
	price	INTEGER, \
	order_id	TEXT UNIQUE, \
	PRIMARY KEY(bill_id), \
    CONSTRAINT fk_order_id FOREIGN KEY(order_id) REFERENCES orders(order_id) ON DELETE CASCADE\
);")

conn.execute("CREATE TABLE menu ( \
	dish_id	TEXT, \
	price	INTEGER, \
	dish_name	TEXT, \
	PRIMARY KEY(dish_id)\
);")

conn.execute("CREATE TABLE order_items ( \
	order_id TEXT, \
	quantity INTEGER, \
	dish_id	TEXT, \
    PRIMARY KEY(order_id,dish_id),\
    CONSTRAINT fk_order_id FOREIGN KEY(order_id) REFERENCES orders(order_id) ON DELETE CASCADE,\
    CONSTRAINT fk_dish_id FOREIGN KEY(dish_id) REFERENCES menu(dish_id) ON DELETE CASCADE\
);")


conn.execute("CREATE TABLE visits (\
    branch_id TEXT, customer_id TEXT, \
    visit_date DATE, \
    visit_count INTEGER, \
    PRIMARY KEY(branch_id,customer_id,visit_date),\
    CONSTRAINT fk_branch_id FOREIGN KEY(branch_id) REFERENCES branch(branch_id) ON DELETE CASCADE,\
    CONSTRAINT fk_customer_id FOREIGN KEY(customer_id) REFERENCES customer(customer_id) ON DELETE CASCADE\
    );")


